var b="url",c="센터장_v1.html",d="generationDate",e=new Date(1716342748068.97),f="defaultAdaptiveView",g="name",h="Base",i="size",j="width",k=1440,l="height",m=900,n="adaptiveViews",o="sketchKeys",p="",q="s0",r="variables",s="OnLoadVariable",t="page",u="packageId",v="f1161676be9d483b980eddf690329b3b",w="type",x="Axure:Page",y="센터장_v1",z="notes",A="annotations",B="fn",C="1",D="ownerId",E="f9a4487501ae467fb85d8cdd7cff5083",F="label",G="(Rectangle)",H="Note",I="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">대시보드 화면</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- 직영일 경우에만 대시보드 활성화(가맹은 기존 메인화면 동일)</span></p><p><span style=\"font-family:'Noto Sans KR';\">- [</span><span style=\"font-family:'Noto Sans KR';font-weight:400;\">타임넷 전광판] &gt; [익힘관리] 내 조회 항목에서 조회되는 센터 기준으로 </span><span style=\"font-family:'Noto Sans KR';\">대시보드 조회 되는&nbsp; </span><span style=\"font-family:'Noto Sans KR';font-weight:400;\">화면이 달리 구현 됨</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; * 엠스위치 교육기관이 타임넷 익힘관리 교육기관에 있을 경우: 모든 항목 조회 </span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; * 엠스위치 교육기관이 타임넷 익힘관리 교육기관에 없을 경우:</span><span style=\"font-family:'Noto Sans KR';\"> 성적 항목의 4건 숨김처리, 나머지는 조회 가능</span></p>",J="2",K="9c8a3e60accc499bae24ae8566367b9c",L="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">그룹/교육기관</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- 조회 정보: 회원 권한별로 조회 조건 다름</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; * 본부장, 사업부장, 센터장: 조회정보는 아이디에 부여 된 모든 교육기관 소속 정보 일괄 조회(그룹/교육기관 변경해도 동일한 데이터 조회)</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; * 시스템관리자: </span><span style=\"font-family:'Noto Sans KR';\">조회 정보는 선택 한 교육기관 소속 정보</span><span style=\"font-family:'Noto Sans KR';font-weight:400;\"> 조회(그룹/교육기관 변경 시 각 교육기관별 데이터만 조회)</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; *&nbsp; 나머지 권한: 대시보드 화면 접근불가(기존 메인화면으로 랜딩)</span></p>",M="3",N="66e0779f11ff459eb0705c07f77e697b",O="검색",P="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">검색기능 제공</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">1) 클릭 시, 검색 기능 레이어 활성</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">2) 검색정보 클릭 시, 해당 메뉴 팝업 활성</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">3) 옵션 내 필터링 제공</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">※ 추후 v2.0에 개발 예정</span></p>",Q="4",R="16aa9b984cf745d49b92648fe27370fc",S="(Text Field)",T="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">최상단 영역</span></p><p><span style=\"font-family:'Noto Sans KR';\">1) 공지사항 배너</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 기존 사용하던 배너 그대로 사용</span></p><p><span style=\"font-family:'Noto Sans KR';\"><br></span></p><p><span style=\"font-family:'Noto Sans KR';\">2) 환영 문구: 타이핑 인터렉션</span></p><p><span style=\"font-family:'Noto Sans KR';\">아래 문구 랜덤 노출</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님, 오늘 하루도 반가워요. 😄</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님, 오늘 하루도 기분 좋은 시작을 해보아요. 😄</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님, 방문해주셔서 환영해요! 😍</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님, 오늘도 행복 가득한 하루 되세요! 🍀</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님! 오늘도 함께해 줘서 고마워요. 👍</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님, 방문해주셔서 너무 기뻐요! 🥳</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님! 오늘도 보게 되어서 정말 좋아요. 🌟</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님, 언제나 당신을 여기서 기다리고 있어요. 💖</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님! 오늘은 뭐 하실 계획이세요? 🤔</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님! 대시보드를 통해 다양한 정보를 활용해보시길 바래요. 😃</span></p><p><span style=\"font-family:'Noto Sans KR';color:#0000FF;\">※ 개발공수가 클 경우, </span><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">추후 v2.0에 개발 예정</span></p><p><span style=\"font-family:'Noto Sans KR';\"><br></span></p><p><span style=\"font-family:'Noto Sans KR';\">3) 입력 문구: </span></p><p><span style=\"font-family:'Noto Sans KR';\">- textField이며, 수정버튼(연필) 클릭 시 수정 가능</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 수정 시에는, 취소버튼(X), 확인버튼(✔️) 활성화/수정버튼(연필) 비활성화</span></p><p><span style=\"font-family:'Noto Sans KR';\"><br></span></p><p><span style=\"font-family:'Noto Sans KR';\">4) 금일 날짜 표기</span></p><p><span style=\"font-family:'Noto Sans KR';\">- YYYY. MM. DD(DAY)</span></p>",U="5",V="8dcc7f8cf07b4bc88d912ec589912439",W="위젯 설정",X="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">위젯 설정</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">1) 클릭 시, 위젯 설정 관련 레이어 팝업 활성</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">2) 위젯별로 추가/삭제/활성화 토글 처리 </span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp;&nbsp; ㄴ 본사 지정 위젯은 토글 변경 불가 처리</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">※ 추후 v2.0에 개발 예정</span></p>",Y="6",Z="5705363edc794887b734b588efe6e411",ba="🏆 현재 소속된 전체 교육기관의 1",bb="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">교육기관 평균 인원</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 사용자가 소속한 교육기관의 전체 반의 평균(avg) 인원 수</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 인원: 첫째자리 실수이며, 둘째자리 반올림 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 당해년도, 전월 말일 기준</span></p>",bc="7",bd="2f7cade2e6204b009a389e02cb85249d",be="목표 매출 달성률",bf="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">목표 매출 달성률</span></p><p><span style=\"font-family:'Noto Sans KR';\">1) 교육기관별: 당해년도 기준</span></p><p><span style=\"font-family:'Noto Sans KR';\">2) 월별 합계: 당해년도 기준</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 교육기관 선택 시, 월별 합계 앞에 교육기관 표기 적용(ex. 교육기관2/합계 선택 시 확인 가능)</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 목표달성률/전년비: </span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 첫째자리 실수이며, 둘째자리 반올림 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 100%미만 일경우 </span><span style=\"font-family:'Noto Sans KR';color:#0000FF;\">파란색</span><span style=\"font-family:'Noto Sans KR';\">/100%이상일 경우 </span><span style=\"font-family:'Noto Sans KR';color:#D9001B;\">빨간색</span></p><p><span style=\"font-family:'Noto Sans KR';\">※ 데이터 null 값이면 &quot;-&quot; 표기(기호 포함X)</span></p>",bg="7.1",bh="5aa3330567d048b6ae8b7fbefe7f5bd0",bi="교육기관1",bj="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">그리드 정보</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- 교육기관 선택 시, 교육기관 월별자료를 조회</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; * 디폴트: 모든 교육기관 총 합계 데이터</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; * 교육기관 선택: 긱 교육기관 월별자료 조회</span></p>",bk="8",bl="d4684f6c3f4447e5be4dc75b959cd75d",bm="목표 학생수 달성률",bn="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">목표 학생수 달성률</span></p><p><span style=\"font-family:'Noto Sans KR';\">1) 교육기관별: 당해년도/월 마감 기준</span></p><p><span style=\"font-family:'Noto Sans KR';\">2) 월별 합계: 당해년도 기준</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 교육기관 선택 시, 월별 합계 앞에 교육기관 표기 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 목표달성률/전년비: </span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp; * 첫째자리 실수이며, 둘째자리 반올림 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp; * 100%미만 일경우 </span><span style=\"font-family:'Noto Sans KR';color:#0000FF;\">파란색</span><span style=\"font-family:'Noto Sans KR';\">/100%이상일 경우 </span><span style=\"font-family:'Noto Sans KR';color:#D9001B;\">빨간색</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 산업율/퇴원율: 첫째자리 실수이며, 둘째자리 반올림 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">※ 데이터 null 값이면 &quot;-&quot; 표기(기호 포함X)</span></p>",bo="8.1",bp="b1f53208ca6e4ab18298adad67384469",bq="9",br="08439cb2a79a4bdfb036ba79086eed20",bs="성적",bt="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">성적</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 모든 데이터는 누적 현황</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 둘째자리 실수이며, 셋째자리 반올림 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">1) 교육기관별 응시현황</span></p><p><span style=\"font-family:'Noto Sans KR';\">2) 등급별 인원수 및 비율</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; * </span><span style=\"font-family:'Noto Sans KR';\">예비: 입학평가를 보았으나, 등록하지 않은 인원</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 신입: 등록(예비→재원, /퇴원→재원) 후, </span><span style=\"font-family:'Noto Sans KR';text-decoration:underline ;\">1개월</span><span style=\"font-family:'Noto Sans KR';\">에 한하는 인원</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 퇴원: 재원하였으나 그만둔(재원→퇴원) 인원</span></p><p><span style=\"font-family:'Noto Sans KR';\">4) </span><span style=\"font-family:'Noto Sans KR';color:#333333;\">회독수별 성취(등급) 현황</span></p><p><span style=\"font-family:'Noto Sans KR';\">※ 데이터 null 값이면 인원수는 0 표기, 이외는 &quot;-&quot; 표기(기호 포함X)</span></p>",bu="9.1",bv="5c848152b3684b3e8cf647eba8e690c8",bw="(Dynamic Panel)",bx="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">등급별 인원수 및 비율</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- 시험명 내 A/B/C 명칭을 사용하는 시험에 대하여 하나의 시험명으로 통합하여 조회</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">ex)&nbsp; 수학 학기 인증 평가A 중1-1</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; &nbsp; 수학 학기 인증 평가B 중1-1</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; &nbsp; 수학 학기 인증 평가C 중1-1</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp; → 수학 학기 인증 평가 중1-1</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">1) 등급별 인원수 및 비율 / 회독수별 성취(등급) 현황의 정보는 Headcount가 아닌 응시 수입니다. </span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">2) 명칭은 특정 시험코드를 넣어서라도 묶어야하는 작업이 필요</span></p>",by="9.2",bz="7b2cb405a6454abea71a8813db8644a2",bA="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">신입생/퇴원생 등급별 인원<br></span><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- 전일 기준 누적정보로 Headcount 합니다.</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- </span><span style=\"font-family:'Noto Sans KR';font-weight:400;\">학생별 등급 표기 조건식</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">1) 신입, 예비: 입학평가(시험명 C 포함) 중에 가장 등급이 높은 시험 기준</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">2) 재원:</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; 2-1) 입학평가만 있을 경우: 등급이 높은 시험 기준</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; 2-2) 현재 학년과 동일한 시험 학년이며, 2번이상 본 경우(중복): 마지막 시험 기준</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; 2-3) 현재 학년과 다른 시험 학년이 섞여있는 경우: </span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; * 다른 학년 시험 등급(가장 높음) &gt;= 현재 학년 시험 등급(가장 높음): 가장 등급이 높은 시험 기준</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; * 다른 학년 시험 등급(가장 높음) &lt; 현재 학년 시험 등급(가장 높음): 마지막 시험 기준</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">3) 퇴원: 마지막 시험 기준</span></p>",bB="9.3",bC="d44668e40fb64ff39dc4a97fa93b8288",bD="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">회독수별 성취(등급) 현황</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- 시험명 내 A/B/C 명칭을 사용하는 시험에 대하여 하나의 시험명으로 통합하여 조회</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">ex)&nbsp; 수학 학기 인증 평가A 중1-1</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; &nbsp; 수학 학기 인증 평가B 중1-1</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; &nbsp; 수학 학기 인증 평가C 중1-1</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp; → 수학 학기 인증 평가 중1-1<br></span><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">※동일한 학생이 A/B 둘다있을 경우, 머릿수를 학생 기준으로 할 경우 중복 데이터가 있으므로 검증력이 떨어지므로 해당 사항 미적용</span></p>",bE="10",bF="6a86be8c0d5949c7acf8094f6413055c",bG="익힘관리 달성률",bH="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">익힘관리 달성률</span></p><p><span style=\"font-family:'Noto Sans KR';\">1) 오답노트 / 2) 숙제</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * (1) 교육기관별 응시현황: 전체 교육기관 수</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * (2) 이용률 높은 선생님: 전체 교육기관 중 건수 높은 5개 순</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * (3) 이용률 낮은 선생님: 전체 교육기관 중 건수 낮은 5개 순</span></p><p><span style=\"font-family:'Noto Sans KR';\">※ 데이터 null 값이면 인원수는 0 표기<br><br>* 학생 1인당 평균&nbsp; = 건수 / 학생 수(교육기관별 선생님마다 부여 된 학생 수) </span></p><p><span style=\"font-family:'Noto Sans KR';\">※ 당해년도 기준</span></p>",bI="11",bJ="8700b57d71bd42ab845b46d231cf3637",bK="상담 건수 및 전환율",bL="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">상담 건수 및 전환율</span></p><p><span style=\"font-family:'Noto Sans KR';\">1) 교육기관별: 당해년도 기준</span></p><p><span style=\"font-family:'Noto Sans KR';\">2) 월별 합계: 당해년도 기준</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 교육기관 선택 시, 월별 합계 앞에 교육기관 표기 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 목표달성률/전년비: </span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 첫째자리 실수이며, 둘째자리 반올림 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 100%미만 일경우 </span><span style=\"font-family:'Noto Sans KR';color:#0000FF;\">파란색</span><span style=\"font-family:'Noto Sans KR';\">/100%이상일 경우 </span><span style=\"font-family:'Noto Sans KR';color:#D9001B;\">빨간색</span></p><p><span style=\"font-family:'Noto Sans KR';\">※ 데이터 null 값이면 &quot;-&quot; 표기(기호 포함X)</span></p>",bM="11.1",bN="51692ce56c1a44eabf1c88a0272640e1",bO="12",bP="0273c8053a0d47e8907d09adb812abad",bQ="DB확보",bR="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">DB 확보</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 비율: 실수이며, 첫째자리 반올림 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 회원비율: 전체 회원에서 회원수 비율 차</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 비율1: 전체 회원에서 휴대폰연락처(유) 비율 차</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 비율2: 전체 회원에서 마케팅동의 비율 차</span></p><p><span style=\"font-family:'Noto Sans KR';\">※ 데이터 null 값이면 &quot;-&quot; 표기(기호 포함X)</span></p>",bS="13",bT="5c59535d4b6d46b2ad4fd037912366b1",bU="<p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">타임넷 전광판 화면 레이아웃과 동일수준으로 수정 적용</span></p>",bV="14",bW="10bc37570fbf4d3197ab87cc0ca06494",bX="(Image)",bY="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">대시보드 스위치 버튼</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- 원장권한 뿐만 아니라, 직원, 강사 화면 선택하여, 대시보드 변경 가능토록 기능 개선</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">※ 추후 v2 이후 개발 사항입니다.</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">회원권한에 따라 보이는 스위칭 버튼 정의</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">* 센터장 - 센터장, 상담사, 강사</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">* 상담사 - 상담사</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">* 강사 - 강사</span></p>",bZ="style",ca="baseStyle",cb="627587b6038d43cca051c114ac41ad32",cc="pageAlignment",cd="center",ce="fill",cf="fillType",cg="solid",ch="color",ci